	@RequestMapping(value = "/postYeuCau", method = RequestMethod.POST, headers = "Accept=application/json")
	public String addYeuCau(@RequestParam("proID") int id, @RequestParam("proName") String proname,
			@RequestParam("proPrice") double proprice, @RequestParam("proCategory") int procategory,
			@RequestParam("proCook") int procook, @RequestParam("proDesc") String prodesc,
			@RequestParam("img1") MultipartFile file1, @RequestParam("img2") MultipartFile file2,
			@RequestParam("img3") MultipartFile file3) {
		try {
			id = 0;
			YeuCau YeuCau;
			if (id == 0) {
				YeuCau = buildYeuCau(new YeuCau(), proname, proprice, procategory, procook, prodesc,
						file1.getBytes(), file2.getBytes(), file3.getBytes());
				yeucauservice.postYeuCau(YeuCau);

			} else {
				YeuCau = buildYeuCau(this.yeucauservice.getYeuCauById(id), proname, proprice, procategory, procook,
						prodesc, file1.getBytes(), file2.getBytes(), file3.getBytes());
//				yeucauservice.updateYeuCau(YeuCau);
			}
		} catch (IOException e) {
			e.printStackTrace();
		}
		return "redirect:/getProdsByCookId?cookId=" + procook;
	}


